use musictext;

SET FOREIGN_KEY_CHECKS = 0; SET GROUP_CONCAT_MAX_LEN=32768; SET @tables = NULL; SELECT GROUP_CONCAT('`', table_name, '`') INTO @tables FROM information_schema.tables WHERE table_schema = (SELECT DATABASE()); SELECT IFNULL(@tables,'dummy') INTO @tables;
SET @tables = CONCAT('DROP TABLE IF EXISTS ', @tables); PREPARE stmt FROM @tables; EXECUTE stmt; DEALLOCATE PREPARE stmt; SET FOREIGN_KEY_CHECKS = 1;

DROP PROCEDURE IF EXISTS `musictext`.`SP_new_user`;

create table B_Net (
 id integer NOT NULL AUTO_INCREMENT,
 network varchar(50) NOT NULL,
 public bool DEFAULT 1,
 PRIMARY KEY(id));

create table B_Net_Node (
 id integer NOT NULL AUTO_INCREMENT,
 id_net integer NOT NULL,
 enabled bool DEFAULT 1,
 node varchar(100) DEFAULT NULL,
 PRIMARY KEY (id),
 FOREIGN KEY (id_net) REFERENCES B_Net(id));

create table B_Net_Outcome (
 id integer NOT NULL AUTO_INCREMENT,
 id_node integer NOT NULL,
 outcome varchar(100) NOT NULL,
 position integer NOT NULL,
 PRIMARY KEY(id),
 FOREIGN KEY (id_node) REFERENCES B_Net_Node(id));

create table B_Net_Parent (
 id integer NOT NULL AUTO_INCREMENT,
 id_node integer NOT NULL,
 id_parent integer NOT NULL,
 position integer NOT NULL,
 PRIMARY KEY(id),
 FOREIGN KEY (id_node) REFERENCES B_Net_Node(id));

create table User (
 id integer NOT NULL AUTO_INCREMENT,
 name varchar(50) NOT NULL,
 age int NULL,
 gender varchar(1) NULL,
 PRIMARY KEY(id));

create table Rules (
 id integer NOT NULL AUTO_INCREMENT,
 id_net integer NOT NULL,
 id_user integer NOT NULL,
 dynamic bool NOT NULL,
 rule text NOT NULL,
 position integer NOT NULL,
 PRIMARY KEY(id),
 FOREIGN KEY (id_net) REFERENCES B_Net(id),
 FOREIGN KEY (id_user) REFERENCES User(id));

create table B_Net_Prob (
 id integer NOT NULL AUTO_INCREMENT,
 id_node integer NOT NULL,
 id_user integer NOT NULL,
 probability decimal(18,10) NOT NULL,
 position integer NOT NULL,
 PRIMARY KEY(id),
 FOREIGN KEY (id_node) REFERENCES B_Net_Node(id),
 FOREIGN KEY (id_user) REFERENCES User(id));

create table Top_Artists (
 id integer NOT NULL,
 name varchar(50) NOT NULL,
 listened int NULL,
 PRIMARY KEY(id));

create table User_Artists (
 id integer NOT NULL AUTO_INCREMENT,
 id_artist int NOT NULL,
 id_user int NOT NULL,
 PRIMARY KEY(id),
 FOREIGN KEY (id_user) REFERENCES User(id),
 FOREIGN KEY (id_artist) REFERENCES Top_Artists(id));

create table Cluster_Tag (
 id integer NOT NULL AUTO_INCREMENT,
 cluster_tag varchar(50) NOT NULL,
 id_tag int NOT NULL,
 PRIMARY KEY(id));

