insert into Rules (id_net,id_user,dynamic, position,rule) values 
 (@id_net, 1, 1, 1, '(defrule DepositoCluster   (Result_Tag_cluster (Tag_cluster ?tc) (Reliability ?r))   =>   (store "Tag_cluster" ?tc) )'),
 (@id_net, 1, 1, 2, '(deftemplate Result_Mood_meteo   (slot Mood_meteo)   (slot Reliability) )'),
 (@id_net, 1, 1, 3, '(deftemplate Result_Travel_mood  (slot Travel_mood)  (slot Reliability) )'),
 (@id_net, 1, 1, 4, '(deftemplate Result_Tag_cluster  (slot Tag_cluster)  (slot Reliability) )'),
 (@id_net, 1, 1, 5, '(defrule Mood_meteoTriste1  (Temperatura min5)  (Condizioni_meteo Temporale)  (Mezzo Auto)  (Km_to_run min10)  (Momento_viaggio Giorno_feriale)   => (assert (Result_Mood_meteo (Mood_meteo Triste) (Reliability 0.49999999999999994))))'),
 (@id_net, 1, 1, 6, '(defrule Mood_meteoArrabbiato2  (Temperatura 5_15)  (Condizioni_meteo Temporale)  (Mezzo Auto)  (Km_to_run min10)  (Momento_viaggio Giorno_feriale)   => (assert (Result_Mood_meteo (Mood_meteo Arrabbiato) (Reliability 0.6363636363636364))))'),
 (@id_net, 1, 1, 7, '(defrule Mood_meteoArrabbiato3  (Temperatura 15_25)  (Condizioni_meteo Temporale)  (Mezzo Auto)  (Km_to_run min10)  (Momento_viaggio Giorno_feriale)   => (assert (Result_Mood_meteo (Mood_meteo Arrabbiato) (Reliability 0.5))))'),
