DELIMITER //
CREATE PROCEDURE SP_new_user (IN user_name varchar(50))
 BEGIN
 IF EXISTS (select * from musictext.User where name = user_name) THEN
  BEGIN
  select -1 id;
  END;
 ELSE
  BEGIN
  insert into musictext.User (name) values (user_name);
  SET @id = @@identity;
  SELECT @id id;
  insert into B_Net_Prob (id_node,id_user,probability,position)
   select id_node,@id,probability,position from musictext.B_Net_Prob where id_user = 1;
  insert into User_Artists (id_artist,id_user)
   select id_artist,@id from musictext.User_Artists where id_user = 1;
  insert into Rules (id_net,id_user,dynamic,rule,position)
   select id_net,@id,dynamic,rule,position from musictext.Rules where id_user = 1;
  END;
  END IF;
 END //
DELIMITER ;

insert into User_Artists (id_user,id_artist) SELECT 1, id from Top_Artists limit 5;